description:
Educating Reeves (Joy Bear / 2012)

Caroline's rustic existence is shattered when petrol-head, Reeves, drives into her picturesque valley with the purpose of buying her land to build a raceway. Reeves soon discovers country girls are not the push-over he expected and Caroline shows him there is more to life than tarmac and throbbing engines.

Lou Charmelle, Samantha Bentley, Cathy Heaven, Paige Turnah, Jess West, Satine Spark, Paige Fox, Danny D, Seth Strong

Gonzo, Lesbian, Feature, Parody 

